import React, { Component } from 'react'
import '../../styles/episodes.scss'
export default class Episodes extends Component {
    componentDidMount(){
        this.props.getAllEpisodes();
    }
    render() {
        return (
            <>
            <h1>Episodes</h1>
            <div className="episodes">
               
               {this.props.episodes.map(episode=>(
                <div class="card">
                   <p>{episode.name}</p>
                </div>
               ))}
              
            </div>
            
            </>
            
        )
    }
}
